import React from "react";
import { Link } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import InputGroup from "react-bootstrap/InputGroup";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";

const Shoppies = () => {
  return (
    <Container
      className="sticky-top"
      style={{ backgroundColor: "#2A9D8F" }}
      fluid
    >
      <Row>
        <Col xs={2} md={2} className="align-self-end">
          <Link to="/">
            <span
              style={{
                fontSize: "50px",
                fontFamily: "Open Sans",
                color: "white",
                WebkitTextStroke: "1px F8F8F8",
                textShadow: "0px 1px 4px #23430C",
              }}
            >
              The Shoppies
            </span>
          </Link>
        </Col>
        <Col md={8} className="align-self-center mt-2">
        </Col>
        
      </Row>
      <Form>
            <Form.Row className="align-items-center">
              <Col lg="6" className="m-auto">

                <InputGroup className="mb-2">

                  <FormControl
                    placeholder="Enter a Movie Title"
                    pattern="^[A-Za-z0-9']*$"
                  />

                  <InputGroup.Append>
                    <Button variant="outline-secondary bg-light" type="submit">
                      Go
                    </Button>
                  </InputGroup.Append>
                </InputGroup>
              </Col>
            </Form.Row>
          </Form>
    </Container>
  );
};

export default Shoppies;
